import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import logo from "../images/logo.png";
import banner from "../images/backimg.png";
import glb from "../images/globes.png";
import findd from "../images/DreamCourse.png";
import asit from "../images/assistance.png";
import engl from "../images/testPrep.png";
import aust from "../images/austril.jpeg";
import uk from "../images/united-kingdom.jpg";
import canada from "../images/canadaa.jpg";
import us from "../images/us.jpg";
import "../../App.css";

const makeCall = () => {
  window.location.href = "tel:+6281187094";
};

const FreeAssessment = () => {
  const [isFixed, setIsFixed] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsFixed(window.scrollY > 200);
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <div className={`freas ${isFixed ? "fixed" : ""}`}>
      <div className="content">
        <div className="text-container">
          <h1>Free Assessment</h1>
          <p>
            We offer free career counseling and career planning advice to study abroad 
            and settle in leading countries like the USA, UK, Canada, Australia, and more.
          </p>
        </div>
        <button className="assessment-btn">Free Assessment</button>
      </div>
    </div>
  );
};

function Home() {
  return (
    <div className="hmain">
      <div className="marquee-container">
        <div className="marquee-content">
          Welcome To <span>UNIMART OVERSEAS</span> - A Leading Immigration Company üåç‚úàÔ∏è
        </div>
      </div>

      <div className="banner-container">
        <img className="banner-img" src={banner} alt="Banner" />
      </div>

      <div className="hmsec">
        <img className="logo-img" src={logo} alt="Logo" />
        <h1 className="hf1">Study in Best Universities Across the World</h1>
        <p className="hf2">Take the First Step to STUDY ABROAD</p>
      </div>

      <button onClick={makeCall} className="bk">
        Book your free consultation
      </button>

      <div className="pg2">
        <h2 className="hd2">
          Start Your Higher Education Journey with 
          <span className="highlight"> AbroadOptions Overseas Consultants</span>
        </h2>

        <header className="header">
          <nav className="custom-navbar">
            <ul className="nav-links">
              <li className="dropdown">
                <a href="#">Study in Abroad</a>
                <ul className="dropdown-menu">
                  <li><a href="#">Study in USA</a></li>
                  <li><a href="#">Study in UK</a></li>
                  <li><a href="#">Study in Canada</a></li>
                  <li><a href="#">Study in Australia</a></li>
                </ul>
              </li>
              <li><a href="#">About Us</a></li>
              <li><a href="#">Study Loans</a></li>
              <li><a href="#">English Tests</a></li>
              <li><a href="#">Blog</a></li>
              <li><a href="#">Contact Us</a></li>
            </ul>
          </nav>
        </header>

        <div className="glb">
          <img src={glb} alt="Global" />
        </div>

        <h1 className="adv">Unimart Overseas <span>Advantage</span></h1>
        <div className="adpic">
          <div className="find">
            <img src={findd} alt="Find" />
            <p>Finding the Program<br/> That‚Äôs Right for You</p>
          </div>
          <div className="find">
            <img src={asit} alt="Assistance" />
            <p>Curated Expert-led<br/> Application Assistance</p>
          </div>
          <div className="find">
            <img src={engl} alt="English Test" />
            <p>English Assessment<br/>Test Prep On-the-go</p>
          </div>
        </div>

        <div id="carouselExampleFade" className="carousel slide carousel-fade" data-bs-ride="carousel">
          <div className="carousel-inner">
            {[{ img: aust, title: "Australia", desc: "Australia has world-class educational institutions...", link: "/australia" },
              { img: uk, title: "United Kingdom", desc: "Studying In The UK is definitely a life-changing experience...", link: "/uk" },
              { img: canada, title: "Canada", desc: "Canada is undoubtedly the most sought-after countries amongst students...", link: "/canada" },
              { img: us, title: "United States", desc: "Studying In The United States offers wonderful opportunities...", link: "/us" }
            ].map((item, index) => (
              <div className={`carousel-item ${index === 0 ? "active" : ""} position-relative`} key={index}>
                <img src={item.img} className="d-block w-100" alt={item.title} />
                <div className="carousel-caption d-flex flex-column align-items-center justify-content-center position-absolute top-50 start-50 translate-middle text-white text-center">
                  <h1>{item.title}</h1>
                  <p>{item.desc}</p>
                  <a href={item.link} className="btn btn-primary">Read More</a>
                </div>
              </div>
            ))}
          </div>

